Multiple Sarcasms 2010

Verenigde Staten
Drama
97 minuten

geregisseerd door Brooks Branch
met Timothy Hutton, Mira Sorvino en Dana Delany

Gabriel is een man die schijnbaar alles heeft: hij is een succesvol 
architect met een prachtige vrouw, Annie, en een toegewijde dochter, 
Elizabeth. Maar langzaamaan bekruipt hem het gevoel dat hij niet gelukkig 
is. Gabriel besluit een toneelstuk te schrijven over de trieste staat van 
z'n leven. Hij neemt ontslag, laat zich vertegenwoordigen door een 
opdringerige literair agent en hij begint te schrijven. Zijn huwelijk
draait uit op een scheiding, maar heeft z'n stuk succes, en ook al is 
zijn leven anders dan voorheen, toch is hij gelukkiger nu.
